import clsx from "clsx";
import { Moon, Sun, Menu } from "lucide-react";
import Logo2 from "../../../assets/Logo2.png";

const Headers = ({ darkMode, toggleDarkMode }) => { // Tambahkan prop toggleDarkMode
  return (
    <nav
      className={clsx(
        "fixed top-0 z-50 w-full bg-white border-b border-gray-200",
        "dark:bg-gray-800 dark:border-gray-700"
      )}
    >
      <div className="px-2 py-3 lg:px-5 lg:pl-3">
        <div className="flex items-center justify-between mt-5">
          <div className="flex items-center justify-start rtl:justify-end">
            <button
              className={clsx(
                "inline-flex items-center p-2 text-sm text-gray-500 rounded-lg sm:hidden",
                "hover:bg-gray-100 focus:ring-gray-200",
                "dark:text-gray-400 dark:hover:bg-gray-700 dark:focus:ring-gray-600"
              )}
            >
              <Menu className="text-2xl" />
            </button>
            <a href="/#" className="flex items-center space-x-2">
              <img src={Logo2} alt="Logo" className="w-10 h-10" /> {/* Sesuaikan ukuran logo */}
              <span className="text-xl ml-2">AStock</span>
            </a>
          </div>
          <button
            className="dark:bg-slate-50 dark:text-slate-700 rounded-full p-2"
            onClick={toggleDarkMode} // Tambahkan onClick untuk mengubah dark mode
          >
            {darkMode ? <Sun /> : <Moon />}
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Headers;
